  false,\n\t\"url\": null,\n\t\"notes\": \"This is the weighted prevalence of 1,276
  schoolchildren. 1,276 out of 1,280 cases examined had prevalence available. One
  out of 1,276 cases had grade information missed, 564 were in Kindergarten and 711
  in 3rd grade. Prevalence is defined as occurrence of any sealant among all selected
  population. Mean is the average number of teeth with sealant among students with
  sealant in selected population. Region Identifiers and Constituent Counties:t Western
  (Allegany, Frederick, Garrett, Washington); Central D.C. (Howard, Montgomery, Prince
  Georgeu2019s); Southern (Calvert, Charles, St. Maryu2019s); Central Baltimore (Anne
  Arundel, Baltimore City, Baltimore County, Carroll, Harford); Eastern Shore (Caroline,
  Cecil, Dorchester, Kent, Queen Anneu2019s, Somerset, Talbot, Wicomico, Worcester).\",\n\t\"license_title\":
